pragma solidity ^0.7.1;
pragma experimental ABIEncoderV2;
//SPDX-License-Identifier: UNLICENSED

interface ITrustAnchorExtraData_Unique {
    function setTrustAnchorManagerAddress(address _trustAnchorManagerAddress) external returns (bool result);
    function getTrustAnchorManagerAddress() external view returns (address result);
    function doesTrustAnchorHaveUniqueExtraData(address _trustAnchorAddress) external view returns (bool result);
    function setTrustAnchorDataRetrievalEndpoint(string memory _endpointName, uint8[4] memory _ipv4Address) external returns (uint8 result);
    function setTrustAnchorDataRetrievalEndpointIsEnabled(string memory _endpointName, bool _isEnabled) external returns (uint8 result);
    function getTrustAnchorNumberOfEndpoints(address _trustAnchorAddress) external view returns (uint256 result);
    function getTrustAnchorEndpointNameByIndex(address _trustAnchorAddress, uint256 _index) external view returns (bool doesExist, string memory endpointName);
    function getTrustAnchorDataEndpoint(address _trustAnchorAddress, string memory _endpointName) external view returns (bool doesExist, uint8[4] memory ipv4Address, bool isEnabled);
    function getTrustAnchorEndpointNameByEndpointKeccak(address _trustAnchorAddress, bytes32 _endpointKeccak) external view returns (string memory endpointName);
    function setTrustAnchorHashMapping(string memory _hashName, bytes32 _hashValue) external returns (uint8 result);
    function getTrustAnchorNumberOfHashMappings(address _trustAnchorAddress) external view returns (uint256 result);
    function getTrustAnchorHashMappingNameByIndex(address _trustAnchorAddress, uint256 _index) external view returns (bool doesExist, string memory hashMappingName);
    function getTrustAnchorHashMappingValue(address _trustAnchorAddress, string memory _hashMappingName) external view returns (bool doesExist, bytes32 hashValue);
    function getTrustAnchorHashMappingNameByHashMappingKeccak(address _trustAnchorAddress, bytes32 _hashMappingKeccak) external view returns (string memory hashMappingName);
    function setTrustAnchorNumericIdentifier(string memory _numericIdentifierName, uint256 _numericIdentifierValue) external returns (uint8 result);
    function getTrustAnchorNumberOfNumericIdentifiers(address _trustAnchorAddress) external view returns (uint256 result);
    function getTrustAnchorNumericIdentifierNameByIndex(address _trustAnchorAddress, uint256 _index) external view returns (bool doesExist, string memory numericIdentifierName);
    function getTrustAnchorNumericIdentifierValue(address _trustAnchorAddress, string memory _numericIdentifierName) external view returns (bool doesExist, uint256 numericIdentifierValue);
    function getTrustAnchorNumericIdentifierNameByNumericIdentifierKeccak(address _trustAnchorAddress, bytes32 _numericIdentifierKeccak) external view returns (string memory numericIdentifierName);
    function setTrustAnchorKeyValuePair(string memory _keyValuePairName, string memory _keyValuePairValue) external returns (uint8 result);
    function setValidationForKeyValuePairData(address _taAddress, string memory _keyValuePairName, uint256 _nonce) external returns (uint8 result, uint256 numValidations);
    function getKeyValuePairCurrentNonce(address _taAddress, string memory _keyValuePairName) external view returns (uint256 result);
    function getValidationsArrayForKeyValuePairNonce(address _taAddress, string memory _keyValuePairName, uint256 _nonce) external view returns (address[] memory validationsAddressArray);
    function getNumValidationsForLatestKeyValuePair(address _taAddress, string memory _keyValuePairName) external view returns (uint256 result);
    function getTrustAnchorNumberOfKeyValuePairs(address _trustAnchorAddress) external view returns (uint256 result);
    function getTrustAnchorKeyValuePairNameByIndex(address _trustAnchorAddress, uint256 _index) external view returns (bool doesExist, string memory keyValuePairName);
    function getTrustAnchorKeyValuePairValue(address _trustAnchorAddress, string memory _keyValuePairName) external view returns (bool doesExist, string memory keyValuePairValue);
    function getTrustAnchorKeyValuePairNameByKeyValuePairKeccak(address _trustAnchorAddress, bytes32 _keyValuePairKeccak) external view returns (string memory keyValuePairName);
    function setTrustAnchorPublicMetaData(string memory _publicMetaData) external returns (uint8 result);
    function getTrustAnchorPublicMetaData(address _trustAnchorAddress) external view returns (string memory publicMetaData);
}
